import React from 'react';

import logo from "../../assets/logo.svg";
import "./navbar.style.scss";

const Navbar = () => {
    return (
        <div className="nav-bar">
            <div>
                <img src={logo}/>
            </div>
        </div>
    )
}

export default Navbar
